              <Nav.Link to="/" as={Link}  className="nav-link1">Home</Nav.Link>

              <Nav.Link to="/about" as={Link}  className="nav-link2">About</Nav.Link>

              {['bottom'].map((placement, idx) => (
                <OffCanvasExample key={idx} placement={placement} name={placement} />
              ))}
              
